import React, { Component } from 'react';
import axios from 'axios'

class Main extends Component {
    state = { 
        info: []
     }
     componentDidMount() {
         axios.get('https://jsonplaceholder.typicode.com/users')
         .then(response => {
            //  console.log(response)
              this.setState({
                 info: response.data
             })
         })
         .catch(error => {
            //  console.log(error)
         })
     }

    render() { 

        let { info } = this.state
        console.log(info);
        return ( 
            <div>
                { 
                <div>
                    <p>Name: {info.name}</p>
                {/* <h2>address: {info.address.city}</h2> */}
                </div>
                }

            </div>
         );
    }
}

export default Main;
